function Room(props){

    return (
        <div>
            <h3>{props.title}</h3>
            <p>{props.description}</p>
            <p>{props.npeople}</p>
            <p>{props.language}</p>
            <img src={props.img} alt="Just an Imag"/>
        </div>
    )
}

export default Room;
